def directions(position, direction, rows):
    row, col = position
    if direction == "up":
        row = (row - 1) % rows
    elif direction == "down":
        row = (row + 1) % rows
    elif direction == "left":
        col = (col - 1) % rows
    elif direction == "right":
        col = (col + 1) % rows

    return row, col


def print_matrix(matrix):
    for row in matrix:
        print("".join(row))


